import React, { Component } from "react"

export default function Edit(props) {
    const handleEdit = () => {
        props.onSelect(props.id)
    }
    return (
        <>
            <div>
                <button className="button_style" onClick={handleEdit}>
                    Edit
                </button>
            </div>
        </>
    )
}
